(196, '6BSR5NBGAGD7F5JEZ6CSBLMK', 'バター醤油きのこのホイル焼き', 'きのこをバターと醤油で香ばしく包み焼き。旨みたっぷりの香るホイル焼きです。', 800.00, 'https://items-images-production.s3.us-west-2.amazonaws.com/files/bd4a5943135127e315ae6502645a96a764c668b2/original.png', 0, 0, 'BSHQAMZCKMYW2RKQLARD3K55', 'セルフメイドメニュー', 1, 1, '2025-05-21 06:50:39', '2025-05-27 12:40:53', 14, 1, 0, NULL, NULL),
(197, 'KZPHTBTY3BFZXB4ANM6J2S3H', 'さつま芋のブリュレ', 'なめらかに仕上げたさつま芋ペーストに香ばしいカラメルを重ねた、和風ブリュレデザートです。', 300.00, 'https://items-images-production.s3.us-west-2.amazonaws.com/files/19affa0162d89dfcc3fc3fea36081ee59bf402e3/original.png', 0, 0, 'BSHQAMZCKMYW2RKQLARD3K55', 'セルフメイドメニュー', 1, 1, '2025-05-21 08:40:39', '2025-05-27 12:40:53', 17, 1, 0, NULL, NULL),
(198, '2XHJMXGRUOBBCUHFZVL2CSPN', 'ブルーベリーのスキレットスモア', '熱々スキレットで焼き上げたマシュマロに、ブルーベリーの甘酸っぱさがとろける贅沢スモア。', 900.00, 'https://items-images-production.s3.us-west-2.amazonaws.com/files/e6650c478a9ebece9c66eb5d1df5d883706f4996/original.png', 0, 0, 'BSHQAMZCKMYW2RKQLARD3K55', 'セルフメイドメニュー', 1, 1, '2025-05-21 10:10:46', '2025-05-27 12:40:53', 18, 1, 0, NULL, NULL),
(199, 'EYS5FTVX22MG4UFSWHGLLUQ2', 'ブルーベリーのスキレットスモア（アイス添え）', 'とろけるマシュマロとブルーベリーに冷たいバニラアイスを添えた、温冷が楽しめる絶品スイーツ。', 1020.00, 'https://items-images-production.s3.us-west-2.amazonaws.com/files/d83ec5af6a1d029cb0b2a59095b6ba4c4120e3e3/original.png', 0, 0, 'BSHQAMZCKMYW2RKQLARD3K55', 'セルフメイドメニュー', 1, 1, '2025-05-21 10:50:42', '2025-05-27 12:40:53', 20, 1, 0, NULL, NULL),
(200, '2HZEC733J7LTVOFJ2NRUPXKW', 'ダッチオーブンの焼き餃子', 'ダッチオーブンでじっくり焼き上げるパリパリ餃子。香ばしさと肉汁の旨みがクセになる一品です。', 800.00, 'https://items-images-production.s3.us-west-2.amazonaws.com/files/d8c304da0693507489854b6339131fb35fce3522/original.png', 0, 0, 'BSHQAMZCKMYW2RKQLARD3K55', 'セルフメイドメニュー', 1, 1, '2025-05-22 07:20:42', '2025-05-27 12:40:53', 13, 1, 0, NULL, NULL),
(201, 'G5RNQRU4XMQC7QPCURAUNLVU', 'ココア（HOT）', '濃厚なカカオの香りと優しい甘さが広がる、心までほっと温まる定番のホットドリンクです。', 500.00, 'https://items-images-production.s3.us-west-2.amazonaws.com/files/9e4a2486feb2892a3c9756950c5d9609acb36971/original.png', 0, 0, 'FCRARY7T2CCLL6DQJD4PVJUC', 'ソフトドリンク', 1, 1, '2025-05-22 10:40:44', '2025-05-27 12:40:53', 4, 1, 0, NULL, NULL),
(202, 'XW5DYHD5PX6BO5BUYIE4NFUB', '紅茶（ICE）', 'すっきりとした渋みと香りが広がる、食事にぴったりな爽やかで上品なアイスティーです。', 500.00, 'https://items-images-production.s3.us-west-2.amazonaws.com/files/bafc1587ac5e79d7b045cc625245ec43f1001114/original.png', 0, 0, 'FCRARY7T2CCLL6DQJD4PVJUC', 'ソフトドリンク', 1, 1, '2025-05-22 11:00:47', '2025-05-27 12:40:53', 5, 1, 0, NULL, NULL),
(203, 'OZYWDDYBARHJNT7JBIW3SATD', '貸出用ダッチオーブン', '煮込みやローストに最適な本格ダッチオーブン。焚き火調理に便利な貸出用アイテムです。', 200.00, 'https://items-images-production.s3.us-west-2.amazonaws.com/files/f3ac7a07f9454193991f090ee504df04a9a9b909/original.png', 0, 0, '6AC35CLUEAUJ4I74YFTZHFLR', '物販', 1, 1, '2025-05-22 11:30:41', '2025-05-27 12:40:53', NULL, 1, 0, NULL, NULL),
(204, '3KKLINLS6LSJEUPWJZGUHRPI', '紅茶（HOT）', '芳醇な香りと澄んだ味わいが広がる、ゆったりとした時間に寄り添う上品なホットティーです。', 500.00, 'https://items-images-production.s3.us-west-2.amazonaws.com/files/edc67687a9c24870917b8e2f15e3c6162e689030/original.png', 0, 0, 'FCRARY7T2CCLL6DQJD4PVJUC', 'ソフトドリンク', 1, 1, '2025-05-22 14:00:46', '2025-05-27 12:40:53', NULL, 1, 0, NULL, NULL),
